import React from 'react'
import moyna from './Digit/Digit'

const CountDown = (props) => {
    return ( 
        <div className="d-flex">
            <moyna color="red" value={ props.time.min }/>
            <moyna color="green" value={ props.time.sec }/>
            <moyna color="blue" value={ props.time.mli }/>
        </div>
    )
}
export default CountDown
